import React from "react";
import styled from "styled-components";
import PropTypes from "prop-types";

const Container = styled.div``;
const List = styled.div`
display:grid
`;
const Item = styled.div``

// {showPricesList && showPricesList.length > 0 && <div>{showPricesList.map(price => price.id)}</div>}

const showPriceInfo = this.props.showPricesList.map(price => {
    console.log(price)
    return <div>{price.id}</div>
})

const PricesPresenter = ({showPricesList,error,loading}) => loading? (<Container>loading....</Container>):

<Container>
{showPricesList && showPricesList.length > 0 && <div>{showPriceInfo}</div>}
</Container> 

PricesPresenter.prototype={
    showPricesList:PropTypes.array,
    error:PropTypes.string,
    loading:PropTypes.bool.isRequired
}

export default PricesPresenter;
